import React, { useState } from "react";

import {
  Card,
  Row,
  Col,
  Typography,
  // Input,
  // Form,
  // Radio,
  // Select,
  // Tooltip,
  // DatePicker,
  // Button,
  // Table,
} from "antd";


function App() {
  return (
    <div className="App">
      <>
        <Row justify="center">
          <Col>
            <Card style={{ width: "100VW", height: 100 }}>
              <Title level={1}>Register Form</Title>
            </Card>
          </Col>
        </Row>
        <br />
        <br />
      </>
    </div>
  );
}

export default App;
